import React, { useEffect, useState } from 'react';
import Header from './../Header';
import { Table } from  'react-bootstrap';

const Historico = () => {
    const [ buscas, setBuscas ] = useState({});

    useEffect(() => {
        const result = JSON.parse(localStorage.getItem('@squadsFy/search'));
        console.log(result);
        setBuscas(result);
    }, []);


    return (
        <Header>
            {
                buscas != null
                ?
                    <Table hover className="historico">
                        <thead>
                            <tr>
                                <th>Nome buscado</th>
                                <th>Data da busca</th>
                                <th>Tipo</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                buscas.map((busca) => {
                                    return(
                                        <tr>
                                            <td>{busca.value}</td>
                                            <td>{busca.data}</td>
                                            <td>{busca.tipo}</td>
                                        </tr>
                                    );
                                })
                            }
                        </tbody>
                    </Table>
                :
                    <h1>Nenhuma busca realizada.</h1>

            }
        </Header>
    );
}

export default Historico;
